import React from "react";
import { MainMenuButton } from "./MainMenuButton";
const MainMenu = (props) => {


    return(
        <React.Fragment>
            <div class="button-container">
                < MainMenuButton buttonText="Urnik" handleClick={console.log("Urnik")}/>
                < MainMenuButton buttonText="Inventura" />
                < MainMenuButton buttonText="Dodaj izdelke" />
                < MainMenuButton buttonText="Odpis" /> 
            </div>
        </React.Fragment>
    )
}

export { MainMenu };
